 Министерство  промышленности  и  торговли  Российской  Федерации  не  позднее  чем  за  3
календарных  дня  до  дня  начала  приема  заявок  размещает  на  сайте,  на  котором  обеспечивается
проведение  отбора  (с  размещением  указателя  страницы  сайта  на  едином  портале),  объявление  о
проведении отбора (далее - объявление) с указанием:
а)  сроков  проведения  отбора,  даты  и  времени  начала  и  окончания  приема  заявок,  которая  не
может быть ранее 30-го календарного дня, следующего за днем размещения объявления;
б)  наименования,  места  нахождения,  почтового  адреса  и  адреса  электронной  почты
Министерства промышленности и торговли Российской Федерации;
в) результата предоставления субсидии, указанного в пункте 25 настоящих Правил;
г)  доменного  имени  и  (или)  указателей  страниц  сайта  в  сети  "Интернет",  на  котором
обеспечивается проведение отбора;
д)  требований  к  кредитным  организациям,  установленных  пунктом  3  настоящих  Правил,  и
перечня  документов,  представляемых  кредитными  организациями  для  подтверждения  их  соответствия
указанным требованиям;
е) порядка представления заявок и требований, предъявляемых к форме и содержанию заявок;
ж) порядка отзыва заявок и возврата заявок, определяющего в том числе основания для возврата
заявок, порядка внесения изменений в заявки;
з) правил рассмотрения заявок в соответствии с пунктом 12 настоящих Правил;
и) порядка предоставления кредитным организациям разъяснений положений объявления, даты
начала и окончания срока такого предоставления;
к) срока, в течение которого победитель отбора должен подписать соглашение о предоставлении
субсидии;
л)  условий  признания  победителя  отбора  уклонившимся  от  заключения  соглашения  о
предоставлении субсидии;
м) форм заявки и реестра заемщиков.

Основаниями для отказа в заключении соглашения о предоставлении субсидии (отклонения
заявки) являются:
а)  несоответствие  кредитной  организации  требованиям,  установленным  пунктом  3  настоящих
Правил;
б)  несоответствие  кредитного  соглашения  условиям,  установленным  пунктом  5  настоящих
Правил;
в)  несоответствие  заявки  и  прилагаемых  к  ней  документов  требованиям,  установленным
настоящими Правилами и объявлением;
г)  недостоверность  представленной  кредитной  организацией  информации,  в  том  числе
информации о месте нахождения и адресе кредитной организации;
д) исчерпание лимитов бюджетных обязательств;
е) представление кредитной организацией заявки после даты и (или) времени, определенных для
представления заявок;
ж) несогласование Министерством промышленности и торговли Российской Федерации запроса
кредитной  организации  о  возможности  предоставления  финансирования  по  кредитному  соглашению  с
предоставлением  льготной  процентной  ставки  и  (или)  Министерством  экономического  развития
Российской  Федерации  предоставления  субсидии  в  отношении  кредитного  соглашения  (кредитных
соглашений) в случае, предусмотренном абзацем вторым подпункта "к" пункта 4 настоящих Правил,
с указанием финансово-экономического обоснования.

